import React, { Component } from 'react'

export default class MerCart extends Component {
    render() {
        console.log(this.props.mer);
        return (
            <div className="container">
                <tr> 
                    <th scope="col">{this.props.index ? (this.props.index + 1) : ""}</th>
                    <th scope="col"><img className= "cart-img"
                        src={this.props.mer ? this.props.mer.image : ""} />{this.props.mer ? this.props.mer.name : ""}</th>
                    <th scope="col">{this.props.mer ? this.props.mer.size : ""}</th>
                    <th scope="col">{this.props.mer ? this.props.mer.quantity : ""}</th>
                    <th scope="col">{this.props.mer ? this.props.mer.price : ""}</th>
                    <th scope="col">{this.props.mer ? this.props.mer.subTotal : ""}</th>
    
                    <button onClick = {this.onDelete} type="click" className="delete">Delete</button>
                    
                </tr>
            </div>
        )
    }
}
